import React from "react";
import Navbar from "./components/navbar/navbar";
import Search from './components/searchbar/searchBar';
import './App.css'
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import BannerSlider from "./components/Banners/BannerSlider";
import Homecategories from "./components/category/Homecatgory";
import Footer1 from "./components/Footer/Footer1";
import ProductList from "./components/products/Productitem"
import Routing from "./routes/Routes";
import { AuthProvider } from "./provider/AuthProvider";






function App(){


    const fetchCartCount = async () => {
        try {
            // Fetch cart count logic
            console.log('Fetching cart count...');
        } catch (error) {
            console.error('Error fetching cart count:', error);
        }
    };



    return (
        <div className="app-container">
             <div className="alogin-container">
             <AuthProvider>
               <Routing fetchCartCount={fetchCartCount} />
               
              </AuthProvider>
             </div>
              
             <Search />
             <div className="slider-container">
             <BannerSlider />
             </div>
           
             <Homecategories />
             <AuthProvider>
             <ProductList fetchCartCount={fetchCartCount}/>
             </AuthProvider>
               
             <Footer1 />
             
        </div>
       
    );
}

export default App;
